import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom";

import Navbar from "./NavBar";
import Login from "./login";

import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <h1> App.js</h1>
        <Navbar />
        <Route Path="/login" component={Login} />
        <p>
          {" "}
          visit <a href="#anchor">here</a>{" "}
        </p>
      </div>
    </Router>
  );
}

export default App;
